import React, {useState} from 'react'
import './Counter-Style.css';


const Counter = () => {

    const [count, setCount] = useState(0);


    return (
        <div className='counter'>
            <button onClick={
                () => setCount(count + 1)
            }>clique aqui</button>
            <p>{count}</p>
        </div>
    )
}

export default Counter
